INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1001, "春咲 ひより", 2, 1, 0, 1, "お！\nあそこに困ってそうな人発見！", 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1002, "草野 優衣", 2, 1, 0, 1, "大切な人を\n守れるようになりたい…って", 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1003, "士条 怜", 2, 1, 0, 1, "キミに必要な集中力と感性が", 0, "少しは磨かれると思いますよ。", "フェンシングを始めてみては？", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1004, "穂高 みそぎ", 2, 1, 0, 1, "今日はなにして遊ぶ？", 0, "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1006, "風宮 あかり", 2, 1, 0, 1, "ねぇ…", 0, "私といっしょに…\nいかない？", "風宮あかりです", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1007, "出雲 宮子", 2, 1, 0, 1, "プリンたべたいのー", 0, "食べ物の恨みは怖いのー", "出雲宮子なのー", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1008, "虹村 雪", 2, 1, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "いいよ。\n見られることは運命さ…", "ボクは虹村雪。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1009, "柊杏奈", 2, 1, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1010, "姫宮 真歩", 2, 1, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1011, "衣之咲 璃乃", 2, 1, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, "ここで会ったが\n100年目～！", "衣之咲璃乃です！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1012, "柏崎 初音", 2, 1, 0, 1, "ち、超能力って…\n何のことかな～？", 0, "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1016, "美波 鈴奈", 2, 1, 0, 1, "一応カリスマ読モJKやってまっす！", 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1017, "喜屋武 香織", 2, 1, 0, 1, "東京は遊園地みたいなところさー", 0, "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1018, "支倉 伊緒", 2, 1, 0, 1, "先生って呼ばれるのは\nくすぐったいから", 0, "イオちゃんって呼んでね。", "支倉伊緒です。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1020, "茜 ミミ", 2, 1, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1021, "栗林 くるみ", 2, 1, 0, 1, "あの……\nふぇ……", 0, "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1022, "風宮 より", 2, 1, 0, 1, "こんな私に貴重な時間を\n割いていただき、", 0, "なんてありがとうございます！", "風宮よりです。\nあああああ！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1023, "北条 綾音", 2, 1, 0, 1, "おにいちゃんどこいくの？\nえ？", 0, "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1025, "天野 すずめ", 2, 1, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1027, "倉石 恵理子", 2, 1, 0, 1, "あなたは…運命の……\n伴侶……", 0, "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1028, "佐々木 咲恋", 2, 1, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1029, "桜井 望", 2, 1, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", 0, "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1030, "ニノン・ジュベール", 2, 1, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1031, "上喜 しのぶ", 2, 1, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", 0, "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1033, "野戸まひる", 2, 1, 0, 1, "けんども\nそれには足りないモンが…", 0, "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1034, "綾瀬 ゆかり", 2, 1, 0, 1, "ちょっと緊張しちゃって…", 0, "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1036, "氷川 鏡華", 2, 1, 0, 1, "知らない人とは話しちゃいけないので", 0, "これ以上お話しすることは…\nないです！", "氷川鏡華…です", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1038, "柏崎 栞", 2, 1, 0, 1, "……あ、アラーム。", 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1040, "双葉 碧", 2, 1, 0, 1, "私、一人も友達がいなくて……", 0, "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1042, "三角 千歌", 2, 1, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "そう思っています。", "三角千歌です。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1043, "安芸 真琴", 2, 1, 0, 1, "あぁ？\nお前のそいつの仲間か？", 0, "う、疑ってすまなかったな…", "安芸真琴だ。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1044, "イリヤ・オーンスタイン", 2, 1, 0, 1, "生けとし生ける全ての者よ！", 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1045, "遠見 空花", 2, 1, 0, 1, "ぐふふふふ……はっ！", 0, "ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1046, "宮坂たまき", 2, 1, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1048, "大神 美冬", 2, 1, 0, 1, "それでは早速クエストに…", 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1049, "星野静流", 2, 1, 0, 1, "クエストもバトルも\n掃除も洗濯も", 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1050, "玉泉美咲", 2, 1, 0, 1, "見ての通りの\nセクシー美少女で", 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.4, 0, 0, 0, 1052, "リマ", 2, 1, 0, 1, "？？？？", 0, "？？？？", "？？？", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1053, "モニカ・ヴァイスヴィント", 2, 1, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 1);
