INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1059, "コッコロ", 2, 1, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 1);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (1.5, 0, 0, 0, 1060, "キャル", 2, 1, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 1);
